octave_code:
function count = count_numbers(base3_digits, base6_digits)
  % Convert base3_digits to base-10
  base3_numbers = base3_digits * 3.^(0:base3_digits-1);

  % Convert base6_digits to base-10
  base6_numbers = base6_digits * 6.^(0:base6_digits-1);

  % Find common numbers
  common_numbers = intersect(base3_numbers, base6_numbers);

  % Count the common numbers
  count = length(common_numbers);
end

% Call the function with the given constraints
count = count_numbers(4, 2);
printf('%.15g\n', count);

