function decimal = base3_to_decimal(base3)
  decimal = 0;
  for i = 1:length(base3)
    decimal = decimal + base3(i) * 3^(length(base3) - i);
  endfor
endfunction

% Define a function to convert decimal to base-3
function base3 = decimal_to_base3(decimal)
  base3 = [];
  while decimal > 0
    base3 = [base3, mod(decimal, 3)];
    decimal = floor(decimal / 3);
  endwhile
  base3 = fliplr(base3);
endfunction

