% Define a function to check if a number is prime
function is_prime = is_prime_number(n)
  if n < 2
    is_prime = false;
  else
    for i = 2:floor(sqrt(n))
      if mod(n, i) == 0
        is_prime = false;
        return
      endif
    endfor
    is_prime = true;
  endif
endfunction

% Define a function to check if a number is a perfect square
function is_square = is_square_number(n)
  is_square = (sqrt(n) == floor(sqrt(n)));
endfunction

% Initialize variables
min_prime = 2;

% Loop through numbers starting from 2
while true
  % Check if the number is a prime and the sum of two distinct perfect squares
  if is_prime_number(min_prime) && is_square_number(min_prime - n^2) && is_square_number(n^2)
    % If true, print the number and exit the loop
    printf('%.15g\n', min_prime);
    break
  endif
  % Increment the number
  min_prime += 1;
endwhile

