% Define the problem
given_data = [];
unknowns = [1, 2, 3, 4, 5];
constraints = {'all_different', 'divisible_by_non_zero_digits'};
applicable_methods = {'brute_force'};
unit_of_measurement = '';

% Initialize the smallest number
smallest_number = 10000;

% Loop through all possible combinations of digits
for i = 1:length(unknowns)
  for j = 1:length(unknowns)
    for k = 1:length(unknowns)
      for l = 1:length(unknowns)
        for m = 1:length(unknowns)
          % Check if the digits are all different
          if all(unknowns(i) ~= unknowns(j) & unknowns(i) ~= unknowns(k) & unknowns(i) ~= unknowns(l) & unknowns(i) ~= unknowns(m))
            % Check if the number is divisible by each of its non-zero digits
            if all(mod(unknowns(i)*10000 + unknowns(j)*1000 + unknowns(k)*100 + unknowns(l)*10 + unknowns(m), unknowns([i, j, k, l, m])) == 0)
              % Update the smallest number
              smallest_number = min(smallest_number, unknowns(i)*10000 + unknowns(j)*1000 + unknowns(k)*100 + unknowns(l)*10 + unknowns(m));
            end
          end
        end
      end
    end
  end
end

% Print the final answer
printf('%.15g\n', smallest_number);

