% Define the function to check if a number is a perfect square and a perfect cube
function is_perfect_square_and_cube = is_perfect_square_and_cube(n)
  is_perfect_square = n == round(sqrt(n));
  is_perfect_cube = n == round(cbrt(n));
  is_perfect_square_and_cube = is_perfect_square && is_perfect_cube;
endfunction

% Loop through integers greater than 10 and check if they are perfect squares and perfect cubes
for n = given_data + 1 : inf
  if is_perfect_square_and_cube(n)
    break
  endif
endfor

