function [sum_of_nice_numbers] = find_sum_of_nice_numbers(given_data)
  sum_of_nice_numbers = 0;
  for i = given_data
    for j = 1:i
      if is_nice_number(j)
        sum_of_nice_numbers = sum_of_nice_numbers + j;
      endif
    endfor
  endfor
endfunction

function [is_nice] = is_nice_number(n)
  is_nice = false;
  for m = 1:n
    if has_four_divisors(m) && sum_of_divisors(m) == n
      is_nice = true;
      break;
    endif
  endfor
endfunction

function [has_four_divisors] = has_four_divisors(m)
  divisors = divisors(m);
  has_four_divisors = length(divisors) == 4;
endfunction

function [sum_of_divisors] = sum_of_divisors(m)
  divisors = divisors(m);
  sum_of_divisors = sum(divisors);
endfunction

function [divisors] = divisors(m)
  divisors = [];
  for i = 1:m
    if mod(m, i) == 0
      divisors = [divisors, i];
    endif
  endfor
endfunction

