angle_ma = 2 * arc_ma;

% Calculate the angle subtended by arc BN at the center
angle_bn = angle_ma - 2 * angle_cap;

% Calculate arc BN
arc_bn = angle_bn / 2;

% Print the final answer
printf('%.15g\n', arc_bn);

