% Define the given data
AC = 21;
BX = 45;
AX = 30;

% Apply the Angle Bisector Theorem
% The theorem states that the ratio of the lengths of the two segments of the side of the triangle that is split by the angle bisector is equal to the ratio of the lengths of the other two sides of the triangle.
% In this case, the theorem can be written as: AX/AC = BX/BC
% Since we know AX, AC, and BX, we can find BC
BC = (BX * AC) / AX;

% Print the final answer
printf('%.15g\n', BC);

