% Define the division function in base 5
function quotient = div_base5(dividend, divisor)
  quotient = floor(dividend / divisor);
  remainder = mod(dividend, divisor);
  while remainder > 0
    dividend = remainder;
    quotient = quotient * 10 + floor(dividend / divisor);
    remainder = mod(dividend, divisor);
  end
end

% Call the function with the given data
