question:
A circular sector has fixed perimeter, but the central angle $\theta$ and radius $r$ are allowed to vary.

[asy]
unitsize(2 cm);

pair A, B, O;

A = (1,0);
B = dir(110);
O = (0,0);

draw(A--O--B);
draw(arc(O,1,0,110));

label("$r$", (O + A)/2, S);
label("$r$", (O + B)/2, SW);
label("$\theta$", (0.1,0.15));
[/asy]

Which central angle $\theta$ maximizes the area of the circular sector?  Give the answer in radians.

Note: The arc length of the sector is $r \theta,$ and the area of the sector is $\frac{r^2 \theta}{2}.$

octave_code:
function [theta] = max_sector_area(perimeter)
  % Define the objective function
  fun = @(r, theta) -r^2*theta/2;

  % Define the constraint function
  nonlcon = @(r, theta) perimeter - 2*r - r*theta;

  % Set initial guess
  r0 = 1;
  theta0 = 1;

  % Use fmincon to find the maximum area
  options = optimoptions('fmincon','Display','iter');
  [r, theta] = fmincon(fun, r0, [], [], [], [], 0, [], nonlcon, options);
end

% Call the function with a fixed perimeter
perimeter = 10;
theta = max_sector_area(perimeter);
printf('%.15g\n', theta)

