% Define the function to calculate the least common multiple (LCM)
function lcm = calculate_lcm(a, b)
  lcm = a * b / gcd(a, b);
endfunction

% Define the function to solve the problem
function t = solve_problem()
  % Initialize the smallest possible value for t
  t = 1;

  % Loop until the condition is met
  while true
    % Calculate the LCM of 12 and t
    lcm_12_t = calculate_lcm(12, t);

    % Check if the condition is met
    if lcm_12_t^3 == (12 * t)^2
      % If the condition is met, break the loop
      break;
    endif

    % Increment t
    t++;
  endwhile

  % Return the smallest possible value for t
  return t;
endfunction

% Call the function to solve the problem
t = solve_problem();

% Print the final answer
printf('%.15g\n', t);

