% Define the points A and B
A = [2, 2];
B = [7, 7];

% Define the function to check if a point C is in the region R
function is_in_region = is_in_region(C)
    % Calculate the vectors AB and AC
    AB = B - A;
    AC = C - A;

    % Calculate the dot product of AB and AC
    dot_product = dot(AB, AC);

    % Check if the dot product is positive and the angle between AB and AC is less than 90 degrees
    if dot_product > 0 && acos(dot(AB, AC) / (norm(AB) * norm(AC))) < pi/2
        is_in_region = true;
    else
        is_in_region = false;
    end
end

% Define the function to calculate the area of the region R
function area = calculate_area(lower_bound, upper_bound)
    % Define the grid size
    grid_size = 1000;

    % Initialize the area to 0
    area = 0;

    % Loop over the x and y coordinates
    for x = lower_bound:upper_bound/grid_size:upper_bound
        for y = lower_bound:upper_bound/grid_size:upper_bound
            % Check if the point (x, y) is in the region R
            if is_in_region([x, y])
                % Add the area of the square with side length 1/grid_size to the total area
                area = area + 1/grid_size^2;
            end
        end
    end
end

% Calculate the area of the region R
area = calculate_area(0, 10);

% Print the final answer
disp(area);

