% Define the function to find the largest odd factor of a number
function max_odd_factor = find_max_odd_factor(n)
  max_odd_factor = 1;
  while n > 1
    if mod(n, 2) == 1
      max_odd_factor = n;
      break;
    end
    n = floor(n / 2);
  end
endfunction

% Define the main function to solve the problem
