  % Factorize the given number
  factors = factor(given_data);

  % Find the largest odd factor
  max_odd_factor = find_max_odd_factor(factors(end));

  % Print the result
  printf('%.15g\n', max_odd_factor);
endfunction

% Call the main function
solve_problem();

