Let \[f(x) =
\begin{cases}
5x^2+2&\text{if } x\le a, \\
11x &\text{if } x>a.
\end{cases}
\]Find the smallest possible value for $a$ if the graph of $y=f(x)$ is continuous (which means the graph can be drawn without lifting your pencil from the paper).

octave_code:
% Define the function
f = @(x) piecewise(x <= a, 5*x^2 + 2, x > a, 11*x);

% Find the limit of the function as x approaches a from both sides
left_limit = limit(f, a, 'left');
right_limit = limit(f, a, 'right');

% Set the limits equal to each other and solve for a
a = solve(left_limit == right_limit);

% Print the smallest possible value for a
printf('%.15g\n', a);

% Print the error message
disp('Error: The function getReport is not implemented in Octave.')

