octave_code:
% Define the operations
operations = {"+", "-", "x", "/"};

% Define the equation
equation = "12* 2 / 9* 3 = 4";

% Define the unknowns
unknowns = ["*", "*"];

% Define the possible values for the unknowns
possible_values = [operations, operations];

% Define the number of combinations
num_combinations = length(possible_values{1}) * length(possible_values{2});

% Initialize the correct combination
correct_combination = [0, 0];

% Loop through all combinations
for i = 1:num_combinations
    % Extract the current combination
    current_combination = possible_values{1}(i);
    current_combination = [current_combination, possible_values{2}(mod(i, length(possible_values{2})) + 1)];

    % Replace the unknowns in the equation
    equation = strrep(equation, unknowns{1}, current_combination{1});
    equation = strrep(equation, unknowns{2}, current_combination{2});

    % Evaluate the equation
    result = eval(equation);

    % Check if the result is correct
    if result == 4
        correct_combination = current_combination;
        break;
    end
end

% Print the correct combination
disp(correct_combination);

