function [max_value] = max_value_of_ab_bc_cd(a, b, c, d)
  % Define the function to maximize
  f = @(a, b, c, d) a*b + b*c + c*d;

  % Define the constraint
  g = @(a, b, c, d) a + b + c + d - 1;

  % Use Lagrange multipliers to find the maximum value
  lambda = fmincon(f, [a, b, c, d], [], [], [], [], [0, 0, 0, 0], [1, 1, 1, 1], g, 1);

  % Calculate the maximum value
  max_value = f(lambda(1), lambda(2), lambda(3), lambda(4));
end

