# Define the function to check if there are real solutions to the equation
function has_real_solutions = check_real_solutions(n)
  x = roots([1, 5, -n]);
  has_real_solutions = any(isreal(x));
endfunction

# Define the function to calculate the probability
function probability = calculate_probability(given_data, unknowns, constraints, applicable_methods, unit_of_measurement)
  n = given_data(1):given_data(2);
  has_no_real_solutions = arrayfun(@check_real_solutions, n);
  probability = sum(has_no_real_solutions) / length(n);
endfunction

