given_data = [2, 3, 5, 6, 7, 10, 11];
unknowns = [1000];
constraints = {'not squares', 'not cubes', 'not perfect fifth powers'};
applicable_methods = {'filtering', 'iteration'};
unit_of_measurement = 'integer';

% Define the function to check if a number is a perfect power
function is_perfect_power(n, power)
  x = floor(n^(1/power));
  return (x^power == n);
endfunction

% Define the function to generate the sequence
function sequence = generate_sequence(n)
  sequence = [];
  i = 2;
  while length(sequence) < n
    if !is_perfect_power(i, 2) && !is_perfect_power(i, 3) && !is_perfect_power(i, 5)
      sequence = [sequence, i];
    endif
    i++;
  endwhile
endfunction

% Generate the sequence and find the 1000th term
sequence = generate_sequence(1000);
printf('%.15g\n', sequence(1000));

