function result = count_bead_arrangements()
  % Define the grid size
  grid_size = 3;

  % Define the number of beads
  num_beads = 9;

  % Define the number of colors
  num_colors = 9;

  % Define the colors of the beads
  colors = 1:num_colors;

  % Define the purple and green bead indices
  purple_index = 1;
  green_index = 2;

  % Define the grid
  grid = zeros(grid_size, grid_size);

  % Define the number of arrangements
  num_arrangements = 0;

  % Define the function to check if two beads are adjacent
  function is_adjacent = check_adjacency(i, j, k, l)
    if (abs(i - k) <= 1 && abs(j - l) <= 1)
      is_adjacent = true;
    else
      is_adjacent = false;
    endif
  endfunction

  % Define the function to count the number of arrangements
  function count_arrangements()
    % Loop through all possible arrangements of the beads
    for i = 1:num_beads
      for j = 1:num_beads
        for k = 1:num_beads
          for l = 1:num_beads
            % Check if the purple and green beads are adjacent
            if (check_adjacency(i, j, k, l))
              % If they are adjacent, skip this arrangement
              continue;
            endif
            % Place the beads on the grid
            grid(i, j) = colors(i);
            grid(k, l) = colors(k);
            % Increment the number of arrangements
            num_arrangements++;
          endfor
        endfor
      endfor
    endfor
  endfunction

  % Call the function to count the number of arrangements
  count_arrangements();

  % Print the result
  printf('%.15g\n', num_arrangements);
endfunction

