given_data = [2, 6, 2];
unknowns = [x];
constraints = [];
applicable_methods = ['Newton-Raphson method'];
unit_of_measurement = [];

function [x] = solve_equation(given_data)
  x = given_data(1);
  f = @(x) sqrt(x^2 - 2*x + 2) + sqrt(-x^2 + 6*x - 2) - 2*sqrt(x);
  df = @(x) (x - 1)/sqrt(x^2 - 2*x + 2) - (x - 3)/sqrt(-x^2 + 6*x - 2) - 1/sqrt(x);
  x = newton_raphson(f, df, x);
endfunction

function [x] = newton_raphson(f, df, x)
  tolerance = 1e-15;
  max_iterations = 1000;
  for i = 1:max_iterations
    if abs(f(x)) < tolerance
      break;
    endif
    x = x - f(x)/df(x);
  endfor
endfunction

x = solve_equation(given_data);
printf('%.15g\n', x);

