    if tax_paid >= total_tax
        break
    end

    % Add the tax paid in the current bracket to the total tax paid
    total_tax = total_tax - tax_paid;

    % Add the income in the current bracket to the total income
    income = income + tax_brackets(i) - tax_brackets(i-1);
end

% Print the final answer
printf('%.15g\n', income)
```

