  f = given_data(2); % target amount
  n = 3; % number of years

  % compound interest formula: A = P(1 + r/n)^(nt)
  % rearrange to solve for r: r = (A/P)^(1/(nt)) - 1

  r = (f/p)^(1/(n*1)) - 1;

  % convert to percentage
  r = r * 100;

  printf('%.15g\n', r);
endfunction

solve_problem(given_data, unknowns, constraints, applicable_methods, unit_of_measurement)

