  [x, fval] = fmincon(f, given_data, A, b, [], [], [], [], @(x) deal(x(1) - x(2) > 0, x(1) + x(2) + x(3) == 4), [], options);

  % Print the minimum value
  printf('%.15g\n', fval);
endfunction

