% Define the Apollonius theorem
function AB = apollonius_theorem(AC, BC)
  % Calculate the semi-perimeter
  s = (AC + BC + AB) / 2;

  % Calculate the area of the triangle using Heron's formula
  area = sqrt(s * (s - AC) * (s - BC) * (s - AB));

  % Calculate the median length using Apollonius theorem
  AD = sqrt(2 * (s - AC) * (s - BC));
  BE = sqrt(2 * (s - AC) * (s - AB));

  % Since the medians are perpendicular, the area of the triangle is also the area of the quadrilateral formed by the medians
  area = AD * BE / 2;

  % Solve for AB
  AB = 2 * area / (AD * BE);
end

% Call the function with the given data
AB = apollonius_theorem(22, 31);

% Print the result
disp(AB);

