  y = x.^2 + b*x + c;
endfunction

# Define the distance function
function d = distance(x, y, x0, y0)
  d = sqrt((x - x0).^2 + (y - y0).^2);
endfunction

# Define the least squares method function
function [b, c] = least_squares_method(x, y)
  A = [x.^2, x, ones(size(x))];
  b = pinv(A) * y;
endfunction

# Define the quadratic equation function
function [x, y] = quadratic_equation(a, b, c)
  x = (-b + sqrt(b.^2 - 4*a*c)) / (2*a);
  y = a*x.^2 + b*x + c;
endfunction

# Define the main function
function main()
  # Extract the given data
  x0 = 12;
  y0 = 3;
  x1 = -5;
  y1 = 0;

  # Find the point on the parabola closest to (12, 3)
  [b, c] = least_squares_method([x0, x1], [y0, y1]);

  # Find the y-intercept of the parabola
  y_intercept = c;

  # Print the result
  printf('%.15g\n', [b, c]);
endfunction

main();

