% Simplify the fraction
simplified_fraction = simplify_fraction(numerator, denominator);

% Define the simplify_fraction function
function simplified_fraction = simplify_fraction(numerator, denominator)
  % Find the greatest common divisor (GCD) of the numerator and denominator
  gcd_value = gcd(numerator, denominator);

  % Divide both the numerator and denominator by the GCD
  simplified_numerator = numerator / gcd_value;
  simplified_denominator = denominator / gcd_value;

  % Return the simplified fraction
  simplified_fraction = simplified_numerator / simplified_denominator;
end

% Print the simplified fraction
printf('%.15g\n', simplified_fraction);

