question:
The grid below contains the $16$ points whose $x$- and $y$-coordinates are in the set $\{0,1,2,3\}$: [asy]
size(2.5cm);
for(int i=0; i<4; i+=1) { for(int j=0; j<4; j+=1) { dot((i,j)); }; };
[/asy] A square with all four of its vertices among these $16$ points has area $A$. What is the sum of all possible values of $A$?

octave_code:
% Define the grid points
x = [0, 1, 2, 3];
y = [0, 1, 2, 3];
[X, Y] = meshgrid(x, y);
points = [X(:), Y(:)];

% Calculate the distances between all pairs of points
distances = sqrt(sum((points - points').^2, 2));

% Find the distances that form a square
square_distances = distances(logical(eye(16)));

% Calculate the area of each square
areas = square_distances.^2;

% Sum the areas of all possible squares
sum_of_areas = sum(areas);

% Print the final answer
disp(sum_of_areas);

