function result = solve_problem(n)
  if n < 3
    error('n must be greater than or equal to 3');
  endif

  x = zeros(1, n);
  x(1) = 1;
  x(2) = -1;
  for i = 3:n
    x(i) = 0;
  endfor

  sum_x = sum(x);
  if sum_x != 0
    error('The sum of x is not zero');
  endif

  sum_x_product = 0;
  for i = 1:n-1
    sum_x_product += x(i) * x(i+1);
  endfor
  sum_x_product += x(n) * x(1);

  if sum_x_product > 0
    result = 'F';
  else
    result = 'T';
  endif
endfunction

n = 3;
printf('%.15g\n', solve_problem(n));

